import os
import tempfile

import pytest
import json

from app import app


@pytest.fixture
def client():
    db_fd, app.config['DATABASE'] = tempfile.mkstemp()
    app.config['TESTING'] = True
    client = app.test_client()

    yield client

    os.close(db_fd)
    os.unlink(app.config['DATABASE'])

def test_cleanText(client):
    data = [{"message":"esempio di messaggio da pulireeeeeeeeeeeeee"}]

    headers = {'content-type': 'application/json'}
    rv = client.post('/openReq/cleanText', data=json.dumps(data), headers=headers)

    result_data = [ "messaggio pulire" ]

    json_data = json.loads(rv.get_data())
    assert (json_data == result_data) and  (rv.status_code == 200)

