def test_doSomAndPlot(client):
    data = {"type_chart": "json",
            "w2v_model_id":1,
            "som_model_id":1,
             "tweets":[{"message":"Posso essere chiamato da un operatore 3"}, {"message":"Ci sono appena andato a un negozio e o faccio una promozione o niente! Voglio pagare quando chiamo e non vo "}]}


    headers = {'content-type': 'application/json'}
    rv = client.post('/openReq/doSomAndPlot', data=json.dumps(data), headers=headers)

    json_data = json.loads(rv.get_data())
    assert json_data.keys()==[u'directed', u'graph', u'nodes', u'links', u'multigraph']
    assert rv.status_code == 200

